    <Container>
      {[...Array(9)].map((_, rowIndex) => (
          <Row >
            {[...Array(9)].map((_, colIndex) => (
                <Block colIndex={colIndex} rowIndex={rowIndex} />
              ))
            }
          </Row>
        ))
      }
    </Container>
  )
}

export default Grid;
